import React from 'react';
import styles from './Track.module.css';

const Track = (props) => {


    // Creates the + - button
    const renderAction = () => {
        <button class={styles.TrackAction}>{props.isRemoval ? '-' : '+'}</button>
    };

    return (
        <div className={styles.Track}>
            <div className={styles.TrackInformation}>
                <h3>Track Name</h3>
                <p> Artist | Album</p>
            </div>
            {renderAction()}
        </div>

    );
};

export default Track;
